import React, { Component} from 'react';
import { Link,withRouter,Route, Switch, NavLink } from 'react-router-dom';
import {MenuItems} from './MenuItems'
import './Navbar.css'
import Home from './Home';

class Navbar extends Component{
    
    
    
    
    render(){
        return(
            <nav className="NavbarItems">
                <h1 className="navbar-logo">Pnömani Teşhisi</h1>
                <div className="menu-icon">

                </div>
                <ul className="nav-menu">
                    {MenuItems.map((item,index) =>{
                        return(
                            <li key={index}><Switch>
                               <NavLink to={item.url} className={item.cName}>{item.title}</NavLink></Switch>
                            </li>
                        )
                    })}

                </ul>
                <Switch><Route exact path="/Home" component={Home}/></Switch>
                                

            </nav>
      


        ) }
    
}

export default Navbar
